import React, { useEffect } from 'react';

function Services() {
  useEffect(() => {
    // Fade-in with zoom animation for the services section
    const elements = document.querySelectorAll('.animate-zoom-in');
    elements.forEach((element, index) => {
      element.style.opacity = '0';
      element.style.transform = 'scale(0.9)';
      setTimeout(() => {
        element.style.transition = 'opacity 0.8s ease-out, transform 0.8s ease-out';
        element.style.opacity = '1';
        element.style.transform = 'scale(1)';
      }, index * 200); // Staggered animation with 200ms delay per element
    });
  }, []);

  return (
    <section className="services">
      <div className="services-header">
        <h2 className="animate-zoom-in">SERVICES</h2>
        <div className="service-content">
          {/* Left side: Selling text above, images below */}
          <div className="service-left">
            <div className="service-text selling-text animate-zoom-in">
              <h3>GET HELP WITH Selling</h3>
              <p>
                Our combination of skill, experience, and technology ensures that we can sell your home for the highest possible price!
              </p>
              <div className="service-buttons animate-zoom-in">
                <button className="btn">WHY CHOOSE ME</button>
                <button className="btn">SELLING PROCESS</button>
                <button className="btn">FREE HOME EVALUATION</button>
              </div>
            </div>
            <div className="service-images selling-images animate-zoom-in">
              <img src="/images/selling1.jpg" alt="Selling 1" />
              <img src="/images/selling2.jpg" alt="Selling 2" />
            </div>
          </div>

          {/* Right side: Images above, Buying text below */}
          <div className="service-right">
            <div className="service-images buying-images animate-zoom-in">
              <img src="/images/buying1.jpg" alt="Buying 1" />
              <img src="/images/buying2.jpg" alt="Buying 2" />
            </div>
            <div className="service-text buying-text animate-zoom-in">
              <h3>GET HELP WITH Buying</h3>
              <p>
                We provide expert guidance to help you find your dream home with ease and confidence.
              </p>
              <div className="service-buttons animate-zoom-in">
                <button className="btn">WHY CHOOSE ME</button>
                <button className="btn">BUYING PROCESS</button>
                <button className="btn">CONTACT US</button>
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
}

export default Services;
